                <Route path='/animal/exzotic' component={Cat} />
                <Route/>
                <Route/>
            </BrowserRouter>
            </div>
            <div className='many'>
            <Many/>
           <p>Єто курс валют</p>
                <p>API з пріватбанка</p>
